// SearchResults.js
import React from 'react';

const SearchResults = ({ results }) => {
  console.log(results);
  return (
    <ul className='search-results'>
      {results.map((item, index) => (
        <li key={index}>{item}</li>
      ))}
    </ul>
  );
};

export default SearchResults;
